import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faLinkedinIn, faGithubSquare} from '@fortawesome/free-brands-svg-icons';
import { faEnvelopeSquare, faFilePdf } from '@fortawesome/free-solid-svg-icons';
import React, { Component } from "react";
import "./IconBar.css";

class IconBar extends Component {
    constructor(props) {
      super(props);

    }

    render() {
      return (
        <div className='Icon-container'>
            <FontAwesomeIcon className='logoicon' icon={faLinkedinIn} size={'3x'}/>
            <FontAwesomeIcon className='logoicon' icon={faGithubSquare} size={'3x'}/>
            <FontAwesomeIcon className='logoicon' icon={faFilePdf} size={'3x'}/>
            <FontAwesomeIcon className='logoicon' icon={faEnvelopeSquare} size={'3x'}/>
        </div>
      );
    }
  }

  export default IconBar;
